package com.eden.enforcementService;import org.springframework.boot.SpringApplication;import org.springframework.boot.autoconfigure.SpringBootApplication;import org.springframework.boot.autoconfigure.security.servlet.SecurityAutoConfiguration;import org.springframework.cloud.netflix.eureka.EnableEurekaClient;import org.springframework.cloud.openfeign.EnableFeignClients;import org.springframework.scheduling.annotation.EnableAsync;@EnableEurekaClient@EnableFeignClients@SpringBootApplication(exclude = {SecurityAutoConfiguration.class })@EnableAsyncpublic class EnforcementServiceApplication {    public static void main(String[] args) {        SpringApplication.run(EnforcementServiceApplication.class, args);    }}